- input: "TEXT\x1CC00471292\x1C.TEXT\x1C\x1CF3A\x1CThe committee is in receipt of
    the Request for Additional Information (RFAI) dated August 10th.  Please be advised
    that the initial report filed with the FEC disclosed incorrect election designation
    due to administrative error.  This report now discloses the correct election designations
    for contributions.  The RFAI also notes that a 48 hour notice was filed disclosing
    a contribution from Robert Castellini on 5/27.  Additionally, the RFAI notes that
    a 48 hour notice was not filed for the contribution disclosed on the July Quarterly
    Report for a contribution received from Lisa Castellini on 5/27.  Please be advised
    that the contribution listed on the 48 hour notice from Robert Castellini on 5/27
    was actually received from Lisa Castellini on 5/27, as accurately reported on
    the July Quarterly Report.  Two credits from YourPatriot are disclosed on Schedule
    B.  Please be advised that YourPatriot is an online donation website that collects
    a fee from each contribution that is received and then deposits the remaining
    portion of the contribution into the committee's bank account.  YourPatriot had
    collected more fees than it should have, and therefore credited the committee's
    account.\n"
